import React from "react";

const ResourceInfo = () => {
  return (
    <div className="flex flex-col dropDownDescR">
      <p className="flex flex-col gap-4">
        Offers accurated learning materials, 
        references, and guidance resources related to different career paths 
        and courses. These resources help 
         understand skill requirements, learning paths,and 
        preparation strategies for their chosen career.
      </p>
    </div>
  );
};

export default ResourceInfo;
